graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Edges Machine</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "node1" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node1</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "node2" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node2</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "node3" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node3</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "node4" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node4</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "node5" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>node5</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "node1" -> "node2" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node2" -> "node3" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node3" -> "node4" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node4" -> "node5" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node5" -> "node1" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node1" -> "node3" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "node2" -> "node4" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
